/**
 * Based on this demo http://threejs.org/examples/#webgl_lensflares
 *  it has embedded the images
 * @author Sebastián Sanabria Díaz
 */
     var ABSULIT = ABSULIT || {};
     ABSULIT.lensflare = ABSULIT.lensflare || (function () {
        var object         = {},
            self         = this,
            lensFlare,
            lensFlarePosition,
            lensflare0     = 'data:image/png;base64,',
            lensflare2     = 'data:image/png;base64,',
            lensflare3     = 'data:image/png;base64,';

        object.init = function (position) {
            var dirLight         = new THREE.DirectionalLight( 0xffffff, 0.5 ),
                textureFlare0     = THREE.ImageUtils.loadTexture( lensflare0),
                textureFlare2     = THREE.ImageUtils.loadTexture( lensflare2 ),
                textureFlare3     = THREE.ImageUtils.loadTexture( lensflare3 ),
                flareColor         = new THREE.Color( 0xffffff );

            lensFlarePosition = position;

            dirLight.position.copy(lensFlarePosition).normalize();
            dirLight.color.setHSL( 0.1, 0.7, 0.5 );

            flareColor.setHSL( 0.55, 0.9, 0.5 + 0.5 );

            lensFlare = new THREE.LensFlare( textureFlare0, 700, 0.0, THREE.AdditiveBlending, flareColor );

            lensFlare.add( textureFlare2, 512, 0.0, THREE.AdditiveBlending );
            lensFlare.add( textureFlare2, 512, 0.0, THREE.AdditiveBlending );
            lensFlare.add( textureFlare2, 512, 0.0, THREE.AdditiveBlending );

            lensFlare.add( textureFlare3, 60, 0.6, THREE.AdditiveBlending );
            lensFlare.add( textureFlare3, 70, 0.7, THREE.AdditiveBlending );
            lensFlare.add( textureFlare3, 120, 0.9, THREE.AdditiveBlending );
            lensFlare.add( textureFlare3, 70, 1.0, THREE.AdditiveBlending );

            //lensFlare.customUpdateCallback = lensFlareUpdateCallback;
            lensFlare.position.copy( lensFlarePosition );

            scene.add( dirLight, lensFlare );
        };

        object.update = function (position) {
            var lensFlarePositionCopy = new THREE.Vector3();
            lensFlarePositionCopy.copy(lensFlarePosition)
            lensFlarePositionCopy.add(position);
            lensFlare.position.copy( lensFlarePositionCopy );
        };

        return object;

    })();
